    const handleQueryParametersChange = (updatedParameters) => {
        setQueryParameters(updatedParameters);
        console.log(queryParameters)
    };


    return (
       <Fragment>
            <h1>Filter</h1>
            <div className="Singlefilter">

            <SingleFilter filter={"Category"} onQueryParametersChange={handleQueryParametersChange} />
             {/* <SingleFilter filter={"Category"}/> */}
            </div>

       </Fragment>

    )
}
